use core::ops::Deref;

trait A {}
trait B: A {}
impl<'a> Deref for dyn 'a + B {
    type Target = dyn A;
    fn deref(&self) -> &Self::Target {
        todo!()
    }
}

fn take_a(_: &dyn A) { }

fn take_b(b: &dyn B) {
    take_a(b);
}
```

{{produces}}

### Explanation

The dyn upcasting coercion feature adds new coercion rules, taking priority
over certain other coercion rules, which will cause some behavior change.

